content:
The Data Mapper Post Action calls a Data Mapper Load (post) to write data to Salesforce. It creates or updates sObjects and produces JSON output, which can be referenced in subsequent Integration Procedure steps.

For example:

{
  "Contact_1": [{
    "Id": "0036A000002PeaAQAS",
    "LastName": "Smith",
    "UpsertSuccess": true
  }],
  "Attachment_2": [{
    "Id": "00P6A000000EJ3RUAW",
    "Name": "angular-route.min.js",
    "ParentId": "0036A000002PeaAQAS",
    "UpsertSuccess": true
  }]
}

The Data Mapper name is appended to the node names, allowing for reference of the Id using merge fields.
